import React, {Component} from 'react';
import {Link} from 'react-router-dom'
import axios from "axios";


class TableRow extends Component {
    constructor(props) {
        super(props);
        this.deletesss = this.deletesss.bind(this);
    }
    deletesss(){
        axios.get('http://localhost:7149/api/Employee/'+this.props.obj._id)
            .then(this.setState({redirect: true}))
            .catch(err => console.log(err))
        window.location.replace('/viewEmployee');
    }
    render() {
        return (
           <tr>
                <td>
                   {this.props.obj.id}
               </td>
               <td>
                   {this.props.obj.fname}
               </td>
               <td>
                   {this.props.obj.lname}
               </td>
               <td>
                   {this.props.obj.email}
               </td>
               <td>
                   {this.props.obj.dob}
               </td>
               <td>
                   {this.props.obj.age}
               </td>
               <td>
                   {this.props.obj.salary}
               </td>
               <td>
                   {this.props.obj.department}
               </td>
               <td>
                   <Link to={"/admineditdeliver/"+this.props.obj._id} className="btn btn-success">Edit</Link>
                   {/* <br/><br/> */}  &nbsp;
                   <button onClick={this.deletesss} className="btn btn-danger">Delete</button>
               </td>
           </tr>
        );
    }
}
